INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Sony-Kopfhörer/Sony WH-XB910N.webp;', 'Sony WH-XB910N', 'https://www.amazon.de/Sony-WH-XB900N-Bluetooth-Cancelling-Gestensteuerung-Schwarz/dp/B07RVC23SG/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2VZPCTNT6VICF&keywords=Sony+WH-XB910N&qid=1667232734&qu=eyJxc2MiOiIyLjAyIiwicXNhIjoiMS4yNiIsInFzcCI6IjEuMTMifQ%3D%3D&sprefix=sony+mdr-7506%2Caps%2C70&sr=8-2', '79,99', 4.5, 5250, 0, 'black;Sony;Erwachsener;Wi-Fi;Ohrumschließend;Kabellos;Kunststoff;Extra Bass für satten, kraftvollen Sound|Digitale Geräuschunterdrückung auf Knopfdruck|Quick Attention Modus: blitzschnell die Umgebung durch intuitives Handauflegen wahrnehmen|Optimierbare Klangeinstellungen mit der Sony Headphones Connect App, Google Assistant und Alexa/Siri kompatibel|Bis zu 30 Stunden Akkulaufzeit');
INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Sony-Kopfhörer/ Sony WF-1000XM4.webp;', ' Sony WF-1000XM4', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTozNTAwMzkwMzg1MjQ3MjI0OjE2NjcyMzI3NDE6c3BfYXRmOjIwMDY1OTg5NDgyNjAyOjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FSony-WF-1000XM4-Cancelling-Kopfh%25C3%25B6rer-Akkulaufzeit-Freisprecheinrichtung-Schwarz%2Fdp%2FB095DNPH4R%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3U645LBEY3IPA%26keywords%3DSony%2BWF-1000XM4%26qid%3D1667232741%26qu%3DeyJxc2MiOiIyLjA5IiwicXNhIjoiMS4xMCIsInFzcCI6IjAuOTUifQ%253D%253D%26sprefix%3D%252Caps%252C77%26sr%3D8-1-spons%26psc%3D1', '195,64', 4.3, 8099, 3, 'black;Sony;18-65;Bluetooth, NFC;Im Ohr;Kabellos;Kunststoff, Kunstleder;Branchenführendes Noise Cancelling dank integriertem V1 HD-Prozessor, einer leistungsstarken neuen Treibereinheit sowie innovativen geräuschminimierenden Ohrstöpseln mit stabilerem Halt.|Hochwertiger Sound und kabelloses Hörvergnügen mit DSEE Extreme und LDAC. Für absoluten Komfort können die Bluetooth-Kopfhörer mit zwei Bluetooth-Geräten gleichzeitig gekoppelt werden. Bei Eingang eines Anrufes, weiß der Kopfhörer, welches der Geräte klingelt und verbindet sich automatisch mit diesem. *Firmware-Update erforderlich. Firmware wird im Winter 2022/2023 verfügbar sein|Mit Speak-to-Chat hält die Musik automatisch an, wenn Sie sprechen, der Näherungssensor sorgt für adaptive Wiedergabe und zwei Beschleunigungssensoren erkennen, ob die Kopfhörer aufgesetzt sind oder nicht.|Ungestörte Unterhaltung dank unkomplizierter Freisprechfunktion. Die WF-1000XM4 Kopfhörer sorgen für eine klarere Stimmübertragung, sodass Sie selbst in lauten Umgebungen Ihren Gesprächspartner deutlich verstehen können.|Der integrierte Lithium-Ionen-Akku sorgt für bis zu 24 Stunden Musikgenuss (mit Noise Cancelling) mit einer einzigen Aufladung. Mit der Schnellladefunktion können Sie nach nur 5 Minuten Laden weitere 60 Minuten Musik hören.|Stand 26. April 2021: Gemäß Untersuchungen der Sony Corporation, basierend auf den JEITA-konformen Richtlinien, im Markt für vollständig kabellose Kopfhörer mit Noise Cancelling.|Wenn die Geräuschunterdrückungsfunktion oder der Umgebungsgeräuschmodus aktiviert ist, können die Windgeräusche je nach Umgebung lauter sein. Überprüfen Sie in diesem Fall Folgendes: Tippen Sie in der Sony Headphones Connect-App Ton → Umgebungsgeräuschsteuerung an und wählen Sie dann Automatische Windgeräuschunterdrückung. Wenn Sie von Windgeräuschen gestört werden, obwohl die automatische Windgeräuschunterdrückung aktiviert ist, stellen Sie die Geräuschunterdrückungsfunktion und den Umgebungsgeräuschmodus auf AUS. Die Funktion zur automatischen Windgeräuschreduzierung funktioniert nicht bei nur geringem Wind');
INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Sony-Kopfhörer/Sony WH-1000XM4 kabellose Bluetooth Noise Cancelling Kopfhörer.webp;', 'Sony WH-1000XM4 kabellose Bluetooth Noise Cancelling Kopfhörer', 'https://www.amazon.de/Sony-WH-1000XM4-Cancelling-Headphones-Schnellladefunktion-Schwarz/dp/B08C7KG5LP/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1H0HOL8QPVPE5&keywords=Sony+WH-1000XM4+kabellose+Bluetooth+Noise+Cancelling+Kopfh%C3%B6rer&qid=1667232749&qu=eyJxc2MiOiIxLjcyIiwicXNhIjoiMS4zMyIsInFzcCI6IjEuMjEifQ%3D%3D&sprefix=sony+wh-1000xm4+ka%2Caps%2C137&sr=8-3', '267,72', 4.6, 12159, 0, 'black;Sony;Erwachsener;NFC;Ohrumschließend;Kabellos;Kunststoff;Branchenführendes Aktives Noise Cancelling dank des HD Noise Cancelling Prozessor QN1 : Optimierung der Geräuschminimierung an Bewegungsmuster sowie Anpassung an den Luftdruck|LDAC überträgt in etwa die dreifache Menge an Daten (bei einer maximalen Übertragungsrate von 990 Kbit/s) wie herkömmliches BLUETOOTH Audio, sodass Sie High-Resolution-Audio-Inhalte genießen können, in nahezu der gleichen Qualität wie bei einer Verbindung über Kabel. Die weiter entwickelte Digital Sound Enhancement Engine Extreme (DSEE Extreme) optimiert komprimierte digitale Musikdateien, sodass sie nahezu High-Resolution Audio-Qualität erreichen.|Speak-to-Chat stoppt automatisch, wenn sie einem Gespräch sind. Der Näherungssensor schaltet den Kopfhörer aus, sobald dieser nicht mehr getragen wird. Zusätzlich stehen Ihnen weite intelligente Audiofunktionen zur Verfügung für einen für einen satten, klaren, raumfüllenden Klang. Kompatibel mit Amazon Alexa. Perfekte Passform im Around-Ear Design. Mit Bluetooth 4.2 und One-Touch Verbindung via NFC für kabelloses Musikhören|Mit Multipoint Connection, Ihr Sony Kopfhörer kann mit zwei Bluetooth Geräten gleichzeitig verbunden werden.|Lange Akkulaufzeit: bis zu 30 Std. abhängig vom verwendeten Modus. Quick Charge: 10 Min. laden für 5 Std. Musik. Frequenzgang: 4 Hz - 40.000 Hz. Bluetooth Version 5.0, Effektiver Bereich: Sichtverbindung ca. 10 m.|Lieferumfang: Tasche, Steckeradapter zur Verwendung im Flugzeug, Kopfhörerkabel (ca. 1,2 m), USB-Kabel: Typ CTM (ca. 20 cm)|Sony empfiehlt immer die aktuellste verfügbare Software auf Ihrem Gerät zu installieren. Update Benachrichtigungen für WH-1000XM4 und die Updates selbst, werden über die Sony Headphones Connect App bereitgestellt. Die App ist kostenlos im Google Play Store und im Apple Store verfügbar');
INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Sony-Kopfhörer/Sony WH-CH710N.webp;', 'Sony WH-CH710N', 'https://www.amazon.de/Sony-Cancelling-Akkulaufzeit-Around-Ear-Style-Freisprecheinrichtung-Schwarz/dp/B086LLYK4S/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3AKQCKWSGZPUB&keywords=Sony+WH-CH710N&qid=1667232755&qu=eyJxc2MiOiIxLjk4IiwicXNhIjoiMS4wNyIsInFzcCI6IjAuNjYifQ%3D%3D&sprefix=%2Caps%2C68&sr=8-3', '74,99', 4.3, 4858, 0, 'black;Sony;Erwachsener;Bluetooth;Ohrumschließend;Kabellos;Elektrischer Dampfsterilisator;Ob auf einem Langstreckenflug oder auf dem Weg zur Arbeit: Das auf künstlicher Intelligenz basierende automatische Noise Cancelling (AINC) analysiert permanent Ihre Umgebungsgeräusche und setzt den für die Umgebung effektivsten Filter zur Geräuschminimierung ein.|Der integrierte Lithium-Ionen-Akku sorgt für bis zu 35 Stunden Musikgenuss mit einer einzigen Aufladung. Mit der Schnellladefunktion können Sie nach nur 10 Minuten Laden weitere 60 Minuten Musik hören.|Die neuen 30-mm-Treiber dieser Sony-Kopfhörer erzielen einen reinen, klaren Klang, der sich ideal für die Wiedergabe einer großen Bandbreite von Frequenzen eignet - von tiefen Bässen bis hin zu hohen Gesangsfrequenzen.|Weiche, ovale Ohrpolster sorgen für einen ausgezeichneten Tragekomfort, sodass Sie Ihre Lieblingsmusik, Filme und Fernsehsendungen genießen können, ohne zwischendurch den Kopfhörer abnehmen zu müssen. Mit dem anpassbaren Metallgleiter können Sie Ihre Kopfhörer auf die perfekte Größe anpassen.|Lassen Sie Ihr Telefon einfach an Ort und Stelle und nutzen Sie die Freisprechfunktion. Die Kopfhörer WH-CH710N sorgen für eine klarere Stimmübertragung an den Gesprächspartner.|Bei Problemen mit der Bluetooth-Verbindung beachten Sie bitte: Möglicherweise haben die Kopfhörer/Lautsprecher die Bluetooth-Verbindung automatisch auf ein anderes gekoppeltes Gerät umgeschaltet. Trennen Sie die andere Verbindung und versuchen Sie dann erneut, eine Verbindung mit dem gewünschten Gerät herzustellen. Die kabellosen Kopfhörer/Lautsprecher können mit mehreren Geräten gekoppelt werden, jedoch nicht gleichzeitig mit zwei oder mehr Geräten verbunden werden');
INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Sony-Kopfhörer/Sony WH-1000XM5.webp;', 'Sony WH-1000XM5', 'https://www.amazon.de/Sony-WH-1000XM5-Cancelling-Headphones-Schnellladefunktion-Schwarz/dp/B09Y2MYL5C/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3DUWK5DGELY3R&keywords=Sony+WH-1000XM5&qid=1667232762&qu=eyJxc2MiOiIxLjczIiwicXNhIjoiMS4zMSIsInFzcCI6IjEuMjQifQ%3D%3D&sprefix=%2Caps%2C78&sr=8-2', '389,48', 4.4, 1216, 0, 'black;Sony;Erwachsener;Bluetooth;Ohrumschließend;Kabellos;-;Der neue integrierte Prozessor V1 schöpft das volle Potenzial unseres HD Noise Cancelling-Prozessors QN1 aus, um unsere (bereits) branchenführende Geräuschunterdrückungstechnologie noch weiter zu verbessern.|Präzisionsgefertigt für außergewöhnliche High-Resolution Audio-Qualität. Unsere präzise Sprachaufnahmetechnologie mit neu entwickelter Windgeräuschunterdrückung sorgt außerdem dafür, dass Sie bei Anrufen mit diesen Kopfhörern mit Noise Cancelling klar und deutlich hören und gehört werden.|Smart, intuitiv und intelligent. Adaptive Sound Control passt die Klangeinstellungen automatisch an Ihre Umgebung und Aktivität an. Speak-to-Chat unterbricht automatisch die Musik, wenn Sie ein Gespräch führen möchten, ohne dass Sie die Over-Ear-Kopfhörer abnehmen müssen.|Dank Mehrpunktverbindung können die Bluetooth-Kopfhörer mit zwei Geräten gleichzeitig gekoppelt werden. Die Fast Pair Funktion hilft bei Der Suche vom Kopfhörer, wenn dieser nicht auffindbar ist. Swift pair unterstützt bei der Kopplung mit einem PC oder Tablet.|Mit einer Akkulaufzeit von bis zu 30 Stunden (bei eingeschaltetem Noise Cancelling) haben Sie auch auf langen Reisen immer genug Energie. Im Lieferumfang dieser Kopfhörer von Sony ist ein zusammenklappbares Etui enthalten, das die Aufbewahrung und den Transport erleichtert.');
INSERT INTO `sony-kopfhörer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Sony-Kopfhörer/Sony WF-C500.webp;', 'Sony WF-C500', 'https://www.amazon.de/Sony-Wireless-Kopfh%C3%B6rer-Akkulaufzeit-Ladeetui-Schwarz/dp/B09FKGJ1CB/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3FOZTUSWTMVW5&keywords=Sony+WF-C500&qid=1667232768&qu=eyJxc2MiOiIxLjIyIiwicXNhIjoiMC42MSIsInFzcCI6IjAuNDYifQ%3D%3D&sprefix=sony+wh-1000xm5%2Caps%2C78&sr=8-2', '57,80', 4.3, 5051, 0, 'black;Sony;Erwachsener;Bluetooth;Im Ohr;Kabellos;Aluminium;Kompatibles Bluetooth-Profil (*2) A2DP/AVRCP/HFP/HSP|Kommunikationssystem Bluetooth-Spezifikation Version 5.0');
